  \"2013-03-15T11:07:12.322962\",\n\t\"name\": \"accuracy-assessment-points-for-devils-tower-national-monument-vegetation-mapping-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The accuracy assessment field work was
  performed in July and August, 1996 to verify the accuracy of the vegetation communities
  spatial data developed by the USGS-NPS Vegetation Mapping Program for Devils Tower
  National Monument. The data points were randomly distributed stratified according
  to vegetation association over the project area according to protocols developed
  by the Program. Points were located by GPS navigation and the community information
  was collected at the point, without knowledge of the attributes of the vegetation
  spatial data. The data points were compared to the attributes of the polygon in
  which they were contained. Attributes of the polygons or accuracy assessment points
  that did not match were changed during later analysis due to errors in the AA methodology
  or map attribution errors. A contingency table was completed from the final dataset.\",\n\t\"license_title\":
